query.sparql:
PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK {
  { SELECT (COUNT(?countryEurope) AS ?countEurope) {
      ?countryEurope wdt:P31 wd:Q6256; wdt:P30 wd:Q46.
  } }
  { SELECT (COUNT(?countryAsia) AS ?countAsia) {
      ?countryAsia wdt:P31 wd:Q6256; wdt:P30 wd:Q48.
  } }
FILTER(?countEurope > ?countAsia)
}

PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK {
  {
    SELECT ?iran_capital ?iran_population WHERE {
      wd:Q794 wdt:P36 ?iran_capital .
      ?iran_capital wdt:P1082 ?iran_population .
    } ORDER BY DESC(?iran_population) LIMIT 1
  }
  {
    SELECT ?germany_capital ?germany_population WHERE {
      wd:Q183 wdt:P36 ?germany_capital .
      ?germany_capital wdt:P1082 ?germany_population .
    } ORDER BY DESC(?germany_population) LIMIT 1
  }
  FILTER(?iran_population > ?germany_population)
}

PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?answer WHERE {
  { SELECT (COUNT(?island1) AS ?galapagos_count) WHERE {
    ?island1 wdt:P276 wd:Q38095.
  }}
  { SELECT (COUNT(?island2) AS ?hawaiian_count) WHERE {
    ?island2 wdt:P276 wd:Q192626.
  }}
  BIND(IF(?galapagos_count > ?hawaiian_count, "Galápagos Islands", 
         IF(?hawaiian_count > ?galapagos_count, "Hawaiian Islands", "Equal")) AS ?answer)
}

PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
SELECT ?result WHERE {
  {
    SELECT (COUNT(?langsSA) AS ?countSA) WHERE {
      wd:Q258 wdt:P37 ?langsSA
    }
  }
  {
    SELECT (COUNT(?langsET) AS ?countET) WHERE {
      wd:Q115 wdt:P37 ?langsET
    }
  }
  BIND(IF(?countSA > ?countET, "South Africa", "Ethiopia") AS ?result)
}

PREFIX wikibase: <http://wikiba.se/ontology#>
    PREFIX p: <http://www.wikidata.org/prop/>
    PREFIX ps: <http://www.wikidata.org/prop/statement/>
    PREFIX pq: <http://www.wikidata.org/prop/qualifier/>
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
    PREFIX bd: <http://www.bigdata.com/rdf#>
    PREFIX dct: <http://purl.org/dc/terms/> 
    PREFIX geo: <http://www.opengis.net/ont/geosparql#>
    PREFIX psn: <http://www.wikidata.org/prop/statement/value-normalized/> 
    PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#> 
    PREFIX wds: <http://www.wikidata.org/entity/statement/> 
    PREFIX wdv: <http://www.wikidata.org/value/> 
    PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>
    PREFIX wd: <http://www.wikidata.org/entity/> PREFIX wdt: <http://www.wikidata.org/prop/direct/>
ASK {
  {
    SELECT (MAX(?lifetime1) as ?maxlifetime1) WHERE {
      wd:Q152760 wdt:P31 wd:Q5398426; wdt:P577 ?date1.
      BIND(year(now()) - year(?date1) as ?lifetime1)
    }
  }
  {
    SELECT (MAX(?lifetime2) as ?maxlifetime2) WHERE {
      wd:Q7335 wdt:P569 ?birth2; wdt:P570 ?death2.
      BIND(year(?death2) - year(?birth2) as ?lifetime2)
    }
  }
  FILTER(?maxlifetime1 > ?maxlifetime2)
}
